import React from 'react';
import { MDBCol, MDBFormInline, MDBIcon, MDBBtn } from "mdbreact";
import MainNav from './MainNav.js';
import 'mdbreact/dist/css/mdb.css'
import { SocialIcon } from 'react-social-icons';
import { Section } from 'react-smart-sections';
import Footer from './Footer.js';
import MeetTeam from './MeetTeam.js';
import '../Styles/FirstPage.css';

export class FirstPage extends React.Component{
  constructor(props){
    super(props);
    this.state={
      value:""
    };
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  handleChange(event){
    console.log(event.target.value);
    this.setState({value: event.target.value});
  }

  handleSubmit(event){
    event.preventDefault()
    console.log("hi");
    this.props.history.push({
      pathname: '/Listing',
      state: { searchVal: this.state.value }
    });
  }


  render(){
    return(

<div className="firstpage-whole">
<link href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-
awesome.min.css" rel="stylesheet" integrity="sha384-
wvfXpqpZZVQGK6TAh5PVlGOfQNHSoD2xbE+QkPxCAFlNEevoEH3Sl0sibVcOQVnN"
crossOrigin="anonymous"/>


  <MainNav showSearch={false}/>


  <Section className="section">

  <div className = "firstpage-title">
    <strong>RETHINK THE WAY YOU STORE</strong>
  </div>
    <div className="firstpage-search">
      <MDBCol md="6" id="searchCol">
        <MDBFormInline className="md-form" onSubmit={this.handleSubmit}>
          <input className="form-control form-control-sm ml-3 w-75" type="text" placeholder="Search" aria-label="Search" onChange={this.handleChange}/>
        </MDBFormInline>
      </MDBCol>
    </div>


    <div className="firstpage-socialIcons">
      <SocialIcon url="https://www.instagram.com/storeopenspace/" style={{ height: 25, width: 25 }} bgColor="#DE1F2B"/>
      <SocialIcon url="https://www.linkedin.com/company/openspacestorage/" style={{ height: 25, width: 25 }}/>
      <SocialIcon url="https://storeopenspace.com/" style={{ height: 25, width: 25 }}/>
    </div>
  </Section>

  <Section className="section">
    <h1>Cheap, Convenient Self-Storage</h1>
      <div className="boxText">
    <img className="box-image" fluid src="openBox.png"/>

      <div className="textInBox"><p>OpenSpace is a peer to peer self storage platform that connects students looking for storage to people in their university community that have space. We provide a service similar to Airbnb, for storage. OpenSpace allows students to only pay for the space they actually use, and not an entire storage unit. We also have delivery options available!</p></div>
    </div>
  </Section>

  <Section>

  </Section>

  <Section>
    <MeetTeam/>
  </Section>
  <footer>
    <div className="firstpage-footer">
      <Footer/>
    </div>
  </footer>
</div>

    );
  }


}
export default FirstPage;
